import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import FilteredList from './FilteredList'

import { AwesomeButton } from "react-awesome-button";
import { Dropdown } from 'react-bootstrap';
import "react-awesome-button/dist/styles.css";
import 'bootstrap/dist/css/bootstrap.min.css';

class App extends React.Component {

  constructor(props) {
    super(props);
  }


  render() {

    const stocks = [
      {name: "Apple Inc.", tag: "AAPL", stockPrice: 100.24, perform: 2.8, sector: "Technology", image: "Apple.png"},
      {name: "Microsoft Corperation", tag: "MFST", stockPrice: 80.16, perform: -5.4, sector: "Technology", image: "Microsoft.png"},
      {name: "Adobe Inc.", tag: "ADBE", stockPrice: 55.91, perform: 0.2, sector: "Technology", image: "Adobe.jpeg"},
      {name: "Samsung Electronics Co.", tag: "SMSN", stockPrice: 55.15, perform: 2.0, sector: "Technology", image: "Sams.png"},
      {name: "Delta", tag: "DAL", stockPrice: 35.44, perform: -3.2, sector: "Airline", image: "Delta.png"},
      {name: "JetBlue", tag: "JBLU", stockPrice: 15.76, perform: -1.3, sector: "Airline", image: "Jetblue.png"},
      {name: "American Airlines", tag: "AAL", stockPrice: 15.56, perform: -4.2, sector: "Airline", image: "AA.jpg"},
      {name: "United Airlines", tag: "UAL", stockPrice: 21.87, perform: -0.2, sector: "Airline", image: "United.png"},
      {name: "Starbucks Corporation", tag: "SBUX", stockPrice: 1.50, perform: -0.5, sector: "Food", image: "Star.png"},
      {name: "McDonald's Corporation", tag: "MCD", stockPrice: 35.00, perform: -1.3, sector: "Food", image: "Mcd.png"},
      {name: "Domino’s Pizza Inc", tag: "DPZ", stockPrice: 17.00, perform: 1.0, sector: "Food", image: "Dominos.jpg"},
      {name: "Chipotle Mexican Grill Inc", tag: "CMG", stockPrice: 15.00, perform: 6.8, sector: "Food", image: "Chipotle.png"},
    ];


    return (
      <div>
        <FilteredList list={stocks} />
      </div>
    )
  }
}

export default App;
